        }}
      >
        <MDBCol className="py-5">
          <MDBCardTitle className="display-4 m-5 font-bold">
            Start your tech career right now!
          </MDBCardTitle>
          <h5 className="mx-5 mb-5">
            Swedenâ€™s innovative and expansive IT sector is facing a future
            skills shortage, and education and immigration reforms are part of
